import React, { useState } from 'react'
import axios from 'axios'

export const Signup = () => {
    const [user, setUser] = useState({
        name: '',
        emailAddress: '',
        mobileNumber: '',
        password: '',
        state: '',
        city: '',
        course: ''
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUser((prevState) => ({
            ...prevState,
            [name]: value
        }));
    };


    const [formError, setFormError] = ({});
    const validateForm = () => {
        const errors = {};
        if (!user.name) {
            errors.name = 'Required'
        }
        if (!user.emailAddress) {
            errors.emailAddress = 'Required'
        }
        if (!user.mobileNumber) {
            errors.mobileNumber = 'Required';
        }
        else {
            const mobileNumberPattern = /^\d{10}$/;
            if (!mobileNumberPattern.test(user.mobileNumber)) {
                errors.mobileNumber = 'Invalid mobile number format'
            }
        }

            if (!user.password) {
                errors.password = 'Required'
            }
            if (!user.state) {
                errors.state = 'Required'
            }
            if (!user.city) {
                errors.city = 'Required'
            }
            if (!user.course) {
                errors.course = 'Required'
            }
            setFormError(errors);
            return Object.keys(errors).length === 0;
        }

        const handleSubmit = (e) => {
            e.preventDefault();
            if(validateForm()){
                alert('Submited')

                const formData = new FormData();
                Object.entries(user).forEach(([key,value]) => {
                    formData.append(key, value);
                });
                const config = {
                    headers: {
                        "Content-Type": "multipart/form-data",
                    },
                };

                axios.post("",formData, config)
                .then((res) => {
                    console.log(res);
                    navigator('/')
                })
                .catch((err) => console.log(err))
            }
        };

        return (
            <div>
                <div className='Reg_Container'>
                    <form onSubmit={handleSubmit}>
                        {/* user name-------- */}
                        <div className="reg_contant">
                            <input type="text"
                                placeholder='Name'
                                name='name'
                                className='reg_input'
                                onChange={handleInputChange}
                            />
                            <span>{formError.name}</span>
                        </div>

                        {/* user  email Address-------- */}
                        <div className="reg_contant">
                            <input type="text"
                                placeholder=' Email Address'
                                name=' emailAddress'
                                className='reg_input'
                                onChange={handleInputChange}
                            />
                            <span>{formError.emailAddress}</span>
                        </div>

                        {/* user mobile Number-------- */}
                        <div className="reg_contant">
                            <input type="text"
                                placeholder='Enterbyour Mobile Number'
                                name='mobileNumber'
                                className='reg_input'
                                onChange={handleInputChange}
                            />
                            <span>{formError.mobileNumber}</span>
                        </div>

                        {/* user password-------- */}
                        <div className="reg_contant">
                            <input type="password"
                                placeholder='Password'
                                name='password'
                                className='reg_input'
                                onChange={handleInputChange}
                            />
                             <span>{formError.password}</span>
                        </div>

                        {/* user password-------- */}
                        <div className="reg_contant">
                            <select name="state" id="" className='reg_input' onChange={handleInputChange}>
                                <option value="Andaman and Nicobar Islands">Andaman and Nicobar Islands</option>
                                <option value="Andhra Pradesh">Andhra Pradesh</option>
                            </select>
                            <span>{formError.state}</span>
                        </div>

                        {/* user password-------- */}
                        <div className="reg_contant">
                            <select name="city" id="" className='reg_input' onChange={handleInputChange}>
                                <option value="Andaman and Nicobar Islands">Andaman and Nicobar Islands</option>
                                <option value="Andhra Pradesh">Andhra Pradesh</option>
                            </select>
                            <span>{formError.name}</span>
                        </div>

                        {/* user password-------- */}
                        <div className="reg_contant">
                            <select name="course" id="" className='reg_input' onChange={handleInputChange}>
                                <option value="Andaman and Nicobar Islands">Andaman and Nicobar Islands</option>
                                <option value="Andhra Pradesh">Andhra Pradesh</option>
                            </select>
                            <span>{formError.course}</span>
                        </div>

                    </form>
                </div>
            </div>
        )
    }
